widgets_values:
{
  "world": {
    "name": "Eldoria",
    "description": "Eldoria is a realm of enchanted forests and misty highlands, where ancient magic weaves through every living thing. The map shows the different biomes, from forests, deserts and highlands",
    "geography": {
      "continents": [
        {
          "name": "Faerhaven",
          "description": "A verdant land of rolling hills, silver rivers, and colossal oak groves inhabited by hidden fey courts."
        },
        {
          "name": "Dreadmoor",
          "description": "A brooding swampland shrouded in perpetual twilight, its peat-black waters home to will-o’-wisps and marsh wyrms."
        }
      ],
      "oceans": [
        {
          "name": "Sea of Whispers",
          "description": "A deep, sapphire ocean where ghostly voices drift on the wind, and ancient shipwrecks lie beneath ethereal waves."
        }
      ],
      "landmarks": [
        {
          "name": "Silverspine Keep",
          "type": "Castle",
          "location": "Lat: 51.200, Lon: -10.450",
          "description": "A fortress carved into a jagged mountain ridge, its towers glinting with moonlight and warded by dragonbone runes."
        }
      ]
    },
    "nations": [
      {
        "name": "Kingdom of Aurélith",
        "capital": "Goldhaven",
        "government": "Hereditary Monarchy",
        "description": "A prosperous kingdom famed for its golden wheat fields and knightly orders who swear fealty to a benevolent queen."
      },
      {
        "name": "Sylvan Enclave",
        "capital": "Moonlight Glade",
        "government": "Council of Eldertrees",
        "description": "A secretive society of forest guardians—elves and treants—who protect the ancient groves and commune with spirits of nature."
      }
    ]
  },
  "cultures": [
    {
      "name": "Aurélian",
      "customs": "Aurélians celebrate the Harvest of Dawn each autumn, lighting lanterns and dancing in the golden fields to honor the sun’s bounty.",
      "language": "Aurélic",
      "religion": {
        "name": "The Radiant Circle",
        "pantheon": [
          {
            "deity": "Solara, Goddess of Light",
            "domains": ["Sun", "Life"]
          },
          {
            "deity": "Varruk, God of Steel",
            "domains": ["War", "Craftsmanship"]
          }
        ]
      }
    },
    {
      "name": "Sylvan",
      "customs": "Sylvans hold silent moonlit vigils among the ancient trees, offering songs to the forest spirits and weaving wreaths of living vines.",
      "language": "Sylvian",
      "religion": {
        "name": "The Verdant Path",
        "pantheon": [
          {
            "deity": "Lyranna, Maiden of Growth",
            "domains": ["Nature", "Healing"]
          },
          {
            "deity": "Thalos, Lord of Beasts",
            "domains": ["Animals", "Hunt"]
          }
        ]
      }
    }
  ],
  "history": {
    "ancient_events": [
      {
        "year": -1024,
        "title": "The Sundering of Stars",
        "summary": "A celestial rift tore across the skies, infusing Eldoria with raw magic and awakening ancient dragons from slumber."
      },
      {
        "year": -332,
        "title": "Treaty of Silverspine",
        "summary": "After decades of border skirmishes, Aurélith’s queen signed peace with the Sylvan Enclave, forging an alliance against rising darkness."
      }
    ]
  },
  "magic_system": {
    "types": [
      {
        "name": "Runecraft",
        "description": "Mages inscribe glowing runes on stone and metal to channel elemental forces; each rune requires a vow to a spirit of the land."
      },
      {
        "name": "Glamourweaving",
        "description": "A subtle fae art that manipulates perception, creating illusions that can heal or deceive depending on the weaver’s intent."
      }
    ]
  },
  "fauna_flora": {
    "fauna": [
      {
        "name": "Moonshadow Stag",
        "type": "Deer",
        "habitat": "Faerhaven Glades",
        "description": "A magnificent white stag whose antlers glow under the moon; said to grant visions of the future to those who follow it."
      },
      {
        "name": "Fen Wyrm",
        "type": "Serpent",
        "habitat": "Dreadmoor Marshes",
        "description": "A massive, eel-like creature with phosphorescent scales, gliding through misty waters and emerging only at dusk."
      }
    ],
    "flora": [
      {
        "name": "Starblossom Lily",
        "type": "Flower",
        "region": "Silverspine Highlands",
        "description": "A silvery-white bloom that opens only under starlight; its petals can be brewed into a potion that wards off nightmares."
      },
      {
        "name": "Frostfern",
        "type": "Fern",
        "region": "Dreadmoor Swamps",
        "description": "A blue-tinged fern that thrives in cold mist; its leaves can freeze water on contact and are used by healers for ice-bound poultices."
      }
    ]
  }
}
